import React from 'react'
import {Container} from 'react-bootstrap'
import SubTitle from '../Uitily/SubTitle'
 

 const HomeCategory = () => {
  return (
    <Container>
   <SubTitle btntitle="المزيد" title="التصنيفات" />
    </Container>
  );
}

export default HomeCategory
